(5, 'SKT a las Finales', '24/04/24', 'Este domingo a las 9:00 hora peninsular española tendrá lugar una nueva final de los Mundiales de League of Legends, la que pondrá fin a la decimotercera edición de esta competición. Muchos han sido los equipos que han luchado por hacerse con el trofeo más importante de los Esports, pero solo son dos los que optan a él en este momento, T1 y Weibo Gaming.', , 'https://www.marca.com/videojuegos/2023/11/18/65577c4fca4741bc428b45b5.html');
INSERT INTO `tabnoticias` (`id`, `titulo`, `fecha`, `des`, `img`, `link`) VALUES
(6, 'Comienza la Major de CS2', '24/04/24', 'Los mejores equipos de Counter-Strike 2 del mundo se enfrentarán en el PGL CS2 Major Copenhagen 2024 del 17 al 31 de marzo en Dinamarca. Aquí encontrará todo lo que necesita saber sobre el torneo, incluido el calendario, los resultados, el formato, los equipos participantes, la distribución de premios y dónde ver los partidos.', , 'https://www.marca.com/videojuegos/esports/2024/03/28/6605398246163f21148b45d3.html');
INSERT INTO `tabnoticias` (`id`, `titulo`, `fecha`, `des`, `img`, `link`) VALUES
(9, 'Este legendario juego de PC podría llegar a consolas gracias a Microsoft', '25/04/24', 'Todo jugador de PC conoce la historia y la importancia de la franquicia de Blizzard, World of Warcraft, un fenómeno masivo a inicios de siglo que formó una comunidad de millones de jugadores. Hasta ahora, la franquicia se ha mantenido en PC, pues fue pensada para esta plataforma, sin embargo, la ruptura de límites de hardware ha llevado a los desarrolladores a considerar un lanzamiento de la IP en consolas, algo que no es nuevo, pero que ahora se ve más cerca que nunca.', , 'https://worldofwarcraft.blizzard.com/es-es/');
INSERT INTO `tabnoticias` (`id`, `titulo`, `fecha`, `des`, `img`, `link`) VALUES
(10, 'Ghost of Tsushima Director’s Cut será el primer port a PC que incluya soporte para los trofeos', '25/04/24', 'Buenas noticias para todos los que están esperando por la llegada de Ghost of Tsushima Director’s Cut y es que según fue dado a conocer recientemente, el juego será el primer port de PlayStation a PC en ser compatible con el sistema de trofeos de PlayStation.', , 'https://store.playstation.com/es-es/product/EP9000-CUSA13323_00-GHOSTDIRECTORPS4');
INSERT INTO `tabnoticias` (`id`, `titulo`, `fecha`, `des`, `img`, `link`) VALUES
